import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = '<script>alert("XSS Vulnerability Detected")</script>';

    // Locate the search input using its placeholder and fill it with the payload
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill(xssPayload);

    // Take a screenshot after entering the payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Extract the value to confirm it was entered
    const enteredValue = await searchInput.inputValue();

    // Locate the first search button and click it
    const searchButton = page.locator('button.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // Take a final screenshot to observe the result of the submission
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submit.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submit.png'));

    return {
      success: true,
      action: "Attempted XSS injection via the search input field.",
      extractedData: {
        payloadInjected: enteredValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
